using Android_Api.Models;
using Microsoft.AspNetCore.Mvc;


namespace Android_Api.Controllers
{
    [ApiController]
    [Route("[controller]")]
    public class PictureController : ControllerBase
    {
        private static List<Image> Images { get; set; } = new List<Image>();

        [Route("PostPicture")]
        [HttpPost]
        public ActionResult Post([FromBody]Image json) 
        {
            Images.Add(json);
            return Ok("OK");
        }

        [HttpGet]
        public IEnumerable<Image> Get()
        {
            if (Images != null && Images.Count > 0)
                return Images;


            return new List<Image>() { 
                new Image()
                { 
                    ImageName = "Turkey1",
                    ImageString = ""
                },
                new Image()
                {
                    ImageName = "Turkey2",
                    ImageString = ""
                }
            };
        }
    }
}